    false,nt"url": null,nt"notes": "This data set provides the lidar elevations
    for four Oregon State Parks. The four state parks are Clyde Holliday (766 square
    acres) in Grant County, Cove Palisades (15,220 square acres) in Jefferson County,
    Lake Owyhee (2496 square acres) in Malheur County, and White River Falls (2333 square
    acres) in Wasco County. This data set was collected on May 5, 6, 11, 31, and June
    1, 2011. The lidar data are multiple return and are classified as unclassified and
    bare earth. The LiDAR survey used a Leica ALS50 Phase II sensor in a Cessna Caravan
    208B. The sensor operates with Automatic Gain Control (AGC) for intensity correction.
    Depending on acquisition day, weather, and terrain, the Leica system was set to
    acquire 105,000 (120,000 on 6/1/11) laser pulses per second (i.e. 105-120 kHz pulse
    rate) and flown at 900 (700 on 6/1/11) meters above ground level (AGL), capturing
    a scan angle of plus or minus 14 degrees from nadir. These settings were developed
    to yield points with an average native pulse density of greater than or equal to
    8 pulses per square meter over terrestrial surfaces. It is not uncommon for some
    types of surfaces (e.g. dense vegetation or water) to return fewer pulses than the
    laser originally omitted. These discrepancies between the native and delivered density
    will vary depending on terrain, land cover, and the prevalence of water bodies.
    Watershed Sciences, Inc. collected the LiDAR and created this data set for Oregon
    Parks and Recreation Department.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
